import React from "react";
import { ImCancelCircle } from "react-icons/im";
const Model = () => {
  return (
    <div className="model-overlay">
      <div className="model-container">
        <div className="content">Model Box</div>
        <button className="cancel">
          <ImCancelCircle />
        </button>
      </div>
    </div>
  );
};

export default Model;
